import React, { useContext } from 'react'
import { Link } from 'react-router-dom'
import AuthContext from '../context/AuthContext'

const Header = () => {
  let {name} = useContext(AuthContext)
  return (
    <div>
      
      <span> | </span>
      <Link to='/'>Home</Link>
      <span> | </span>
      <Link to='/login'>Login</Link>
    </div>
  )
}

export default Header
